PREFIX wd: <http://www.wikidata.org/entity/> 
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK WHERE { wd:Q164815 wdt:P710 wd:Q190076 }

PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT (COUNT(DISTINCT ?work) AS ?count) WHERE { ?work wdt:P50 wd:Q3495759 . }

PREFIX wdt: <http://www.wikidata.org/prop/direct/>     
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT (COUNT(DISTINCT ?uri) AS ?c )   { ?uri wdt:P31 wd:Q5 . ?uri wdt:P106 ?t }  wd:Q79037  ?uri . ?uri wdt:P27 wd:Q145 . }

PREFIX wd: <http://www.wikidata.org/entity/> 
PREFIX wdt: <http://www.wikidata.org/prop/direct/> select (COUNT(DISTINCT ?uri) as ?count) { 
 wd:Q30603704 ?p ?seasons . 
 }

PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT (COUNT(DISTINCT ?country) AS ?value) WHERE { wd:Q54078 wdt:P1500 ?subsidiary . ?subsidiary wdt:P17 ?country . }

PREFIX wd: <http://www.wikidata.org/entity/> 
PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
SELECT (count(?sbj) as ?sbjcount )  WHERE { 

    ?sbj wdt:P31 wd:Q161476 . ?sbj rdfs:label ?label FILTER(CONTAINS(LCASE(?label), "linguistik")) FILTER(LANG(?label)  = 'de')
 }

PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT ?date WHERE { wd:Q7338128 wdt:P577 ?date . }

PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT ?num1 WHERE { wd:Q815436 wdt:P1269 ?num1 . }

PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT DISTINCT ?uri WHERE { ?uri wdt:P451 wd:Q5879 . ?uri wdt:P31 wd:Q5 }

PREFIX wdt: <http://www.wikidata.org/prop/direct/> 
PREFIX wd: <http://www.wikidata.org/entity/> 
SELECT DISTINCT ?uri ?type WHERE { 
  ?type wdt:P279* wd:Q12192 . 
  ?uri wdt:P1542 ?type .
}
